import base64
import os


def save_base64_image(base64_string, output_dir, filename):
    # 解码 Base64 字符串
    image_data = base64.b64decode(base64_string)

    # 确保输出目录存在
    if not os.path.exists(output_dir):
        os.makedirs(output_dir)

    # 构建输出图片文件路径
    image_path = os.path.join(output_dir, filename)

    # 写入解码后的图像数据到图片文件
    with open(image_path, 'wb') as f:
        f.write(image_data)

    print(f"图片已保存至：{image_path}")


# 示例 Base64 编码字符串
base64_string = ""
# 输出目录
output_directory = "yzm_images"

# 图片文件名
output_filename = "example_image.png"

# 将 Base64 转换为图片并保存
save_base64_image(base64_string, output_directory, output_filename)
